import React, {Component} from 'react';
import Todo from "./Todo";
class TodoList extends Component {
    render() {
        return (
            <div>
                {this.props.todos.map((todo => (
                    <Todo deleteTodos={this.props.deleteTodos} key={todo.id} todo={todo}/>
                )))}

            </div>
        );
    }
}

export default TodoList;
